import React from 'react';

import styles from "./Navbar.module.scss";

function Navbar(props) {
    return (
        <div>
            <h1>P&S</h1>
            <ul>
                <li>Find Writing</li>
                <li>My Writing</li>
                <li>Upload</li>
            </ul>
        </div>
    );
}

export default Navbar;
